import React from 'react';
import './style.css';
import fruits from "./fruits.json";



function Game (props) {
    return (
        <div className="container">
            <div className="row">
                {props.fruits.map(fruit => (
                    <div className="col">
                        <div className="card" onClick={() => props.shuffle()}>
                            <div className="img-container">
                                <img alt={fruit.name} src={fruit.image} />
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )
};

export default Game;
